// CordinatorRegistrationForm.js
import './Register.css';
import React, { useState } from 'react';

const CordinatorRegistrationForm = () => {
  const [formData, setFormData] = useState({
    name: '',
    registrationNumber: '',
    contactNumber: '',
    emailAddress: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission
    console.log(formData);
  };

  return (
    <div>
      <h2>Project Cordinator Registration Form</h2>
      <form onSubmit={handleSubmit}>
      <div className="input-fields">
            <div className="input-field">
              <label>Name:</label>
              <input type="text" name="name" value={formData.name} onChange={handleChange} />
            </div>
            <div className="input-field">
              <label>Registration Number:</label>
              <input type="text" name="registrationNumber" value={formData.registrationNumber} onChange={handleChange} />
            </div>
            <div className="input-field">
              <label>Contact Number:</label>
              <input type="text" name="contactNumber" value={formData.contactNumber} onChange={handleChange} />
            </div>
            <div className="input-field">
              <label>Email:</label>
              <input type="email" name="email" value={formData.email} onChange={handleChange} />
            </div>
        </div>
        <button type="submit">Register</button>
      </form>
    </div>
  );
};

export default CordinatorRegistrationForm;
